                "Pink Floyd's David Gilmour discovered Kate Bush while she was still in her teens.",
                "Her keening dramatic voice provides a vocal template for artists like Tori Amos and Hayley Westerna.",
                "As a child, Kate would sneak off to play organ in her parent's barn in Surrey, England."
