                "Forever the greatest rock band on the planet, the Stones have turned their bluesy brilliance into a way of life.",
                "The Stones' founding bassist, Dick Taylor, would go on to form the underappreciated Pretty Things.",
                "Mick Jagger's acting career has most famously included roles in \"Performance,\" \"Ned Kelly\" and \"Freejack.\"",
                "Mick Taylor joined the Stones in '69 based on a suggestion from legendary English blues man John Mayall.",
                "The first original Jagger/Richards single was \"Tell Me (You're Coming Back To Me),\" released in 1964."
