                    "bio": "Few partnerships in rock 'n' roll have been as productive as the collaboration between Mick Jagger and Keith Richards, and of course having wunderkind Brian Jones along did nothing to hinder the Rolling Stones' popularity. From the get-go, the band played the raunchy, gritty doppelganger to <a href=\"http://rhapsody.com/artist/the-beatles\">the Beatles'</a> dandified Merseybeat pop. They ventured a heavier, bluesier sound than their British Invasion counterparts, taking their cues from <a href=\"http://rhapsody.com/artist/muddy-waters\">Muddy Waters</a> and <a href=\"http://rhapsody.com/artist/howlin-wolf\">Howlin' Wolf</a>. The band's greatest strength, besides Charlie Watts, has always been their ability to add stylistic touches drawn from their interests in Eastern music, psychedelia, country and even disco to a blues rock chassis. It's difficult to listen to the trippy <I>Their Satanic Majesties Request</I>, the down-and-out honky-tonk of <I>Exile On Main Street</I> and the clean modernist surfaces of <I>Bridges To Babylon</I> and believe they were recorded by the same band. Of course, in some ways they weren't; the lineup changes that have dogged the Stones account for much of their musical diversity. Jagger's famous slur and Richards' sloppy guitar elegance are the two constants in the band's many life cycles that make every Stones song instantly recognizable."
