            "bios": [
                {
                    "title": "Bebop Digital",
                    "author": "Bebop Digital",
                    "publishDate": "2015-02-23T00:00:00.000Z",
                    "bio": "For the generation that grew up during the Reagan Era, Journey will always be associated with the sweaty palms and stomach-churning anticipation of grade school dances. Orgasmically dramatic break-up songs employed pulsating synthesizers, massive guitars, and innumerable vocal tracks backing up Steve Perry's pleading falsetto. With this astonishingly successful formula, Journey defined the blow-dried power-ballad that ruled '80s FM radio. After a long hiatus, Journey reformed in 1996, releasing a single and going on a reunion tour. In the early 2000s, minus original singer Steve Perry, Neal Schon and company went back into the studio and began recording new material, which produced <I>Arrival</I>  in 2001 and <I> Generations</I> in 2005."
                }
            ],
