            "name": "David Bowie",
            "shortcut": "david-bowie",
            "amg": "3753",
            "blurbs": [
                "A performer whose career flagrantly defies convention with such finesse that fans not only forgive him, they worship him.",
                "It seems like David Bowie has been around forever. He was born David Jones in January, 1947, in Brixton, England.",
                "Bowie's two different colored eyes are the result of a schoolyard fight.",
                "Bowie's phenomenally successful album \"Let's Dance\" was produced by Chic's Nile Rodgers.",
                "In 1966, David Bowie spent several weeks at a Scottish Buddhist monastery. Upon leaving, he joined a mime troupe."
            ],
            "bios": [
                {
                    "title": "Bebop Digital",
                    "author": "Bebop Digital",
                    "publishDate": "",
                    "bio": "Musicians evolve at the risk of losing their audience -- fans always prefer known quantities to variables. David Bowie is one performer who's made a career out of defying rock convention so flagrantly and with such finesse that fans not only forgive him for it, they worship him. From the fey folk of his pre-<i>Space Oddity</i> days to the right-angled, martinet funk of \"Fashion\" and Tin Machine's bloated hard rock, Bowie's only constant has been his inconstancy. Considering his vast, diffuse output -- three dozen or so albums and counting -- you can hardly fault him for the occasional bit of slag, especially when there are more than enough nuggets to make all the panning worthwhile. At every career turn, Bowie has often sustained his flashes of brilliance  -- <I>The Rise and Fall of Ziggy Stardust</I> and <I>Hunky Dory</I> are two examples among many. His Janus ability to perform with utter candor (as on \"Rock 'n' Roll Suicide\" and \"Quicksand\") and then, in the blink of an eye, don a mask and enter a role (witness the plastic soul of <i>Young Americans</i>) makes Bowie a living puzzle. We're still awaiting all the pieces."
                }
            ],
