            "name": "Electric Light Orchestra",
            "shortcut": "electric-light-orchestra",
            "amg": "709846",
            "blurbs": [
                "ELO's superindulgent pop rock may have been rooted in the Beatles but Jeff Lynne took it directly into outer space.",
                "The band was a loose collective of session players built around principals Jeff Lynne and Bev Bevan.",
                "In 1977 ELO sued their distributor, United Artists, for allegedly flooding the market with defective records.",
                "For all their success, ELO never had a No. 1 single or record.",
                "Good music, bad movie: ELO contributed to the soundtrack for Olivia Newton John's infamous skate epic \"Xanadu.\""
            ],
            "bios": [
                {
                    "title": "Napster                                                                                                                         ",
                    "author": "Napster",
                    "publishDate": "",
                    "bio": "No band better represents the pros and cons of overproduction than ELO. In an era of excess, ELO had no equal for sheer audio opulence. Singer Jeff Lynne frosted his voice in so many coatings of studio sugar that it hardly sounded natural. Singing at the helium-huffing apex of the human voice, he dusted off notes not heard since cherubs gamboled in mythological clouds. Bringing in entire symphonies for heart-fluttering arpeggios on fairy-dusted strings, the band's songs fill the air like mirage waves of sound so glossy, you can almost see your reflection in them. \"Can't Get It Out of My Head\" and \"Telephone Line\" roll gently along like long, lonesome walks on the beach while the Disco/rock hybrids \"Turn to Stone\" and \"Livin' Thing\" still set the mood for fans working on their night moves. It's just physiologically impossible not to get high from inhaling so much production varnish. For some, it will cause euphoria -- for others, altitude sickness."
                }
            ],
