            "name": "Pink Floyd",
            "shortcut": "pink-floyd",
            "blurbs": [
                "The premier psychedelic band of the 1970s, Pink Floyd formed in 1965, incorporating jazz and insanity into their music.",
                "Due to a tragic decline in his mental health, original member Syd Barrett was replaced with David Gilmour in 1967.",
                "\"Dark Side of the Moon\" is the ultimate concept album. Since 1973, over 15 million copies have been sold in the US alone.",
                "In July 2005, David Gilmour, Nick Mason, Richard Wright and Roger Waters reformed for the Live 8 charity concert.",
                "Toni Tennille (of Captain & Tennille fame) sang background vocals on many tracks for \"The Wall.\""
            ],
            "bios": [
                {
                    "title": "CDRISCOLL",
                    "author": "Chad Driscoll",
                    "publishDate": "",
                    "bio": "Early Pink Floyd recordings make space travel superfluous so long as we have keyboards here on Earth. Back when enigmatic lyricist and acid-eater extraordinaire Syd Barrett skippered the ship, the Floyd sounded something like Monty Python with instruments -- quirky, trippy and weird. Barrett made Bedlam seem a reasonable price to pay for such gems as \"Bike,\" \"Lucifer Sam,\" and the Space Rock tour-de-force \"Astronomy Domine.\" Upon Barrett's departure, the only marginally less maniacal Roger Waters took on singing and songwriting duties. The band dug even deeper into labyrinthine song structures, but nothing prior had prepared the world for 1973s <i>Dark Side of the Moon</i>. The concept album par excellence, <i>Moon</i> utilizes a narrative lyric structure and musical leitmotifs to give the album a sense of coherence. These compositional strategies culminated in '79s harrowing magnum opus, <i>The Wall</I>, an unflinching look at England's soul -- its educational system, its flirtations with fascism, the conservatism leading up to Thatcher. After Waters' defection, the remaining members came down with a crippling case of the blands but decided to stick it out, releasing a series of flashy (note '95's <I>Pulse</i>), nostalgic commodities that basically sounded like David Gilmour solo efforts (even if they continued to sell like genuine Pink Floyd productions). In July 2005, David Gilmour, Nick Mason, Richard Wright and Roger Waters reformed for the Live 8 charity concert. Sadly, in July 2006, Syd Barrett died at the age of 60, from complications of diabetes."
                }
            ],
