            "name": "Taylor Swift",
            "shortcut": "taylor-swift",
            "amg": "816977",
            "blurbs": [
                "Taylor Swift is a clever country starlet with a honeyed voice who started writing songs when she was 10.",
                "Swift recorded her self-titled debut album when she was just 16. Remarkably, she wrote all 12 songs.",
                "She was brought up in a musical family. Her grandmother was a professional opera singer and had Taylor singing as a child.",
                "At the young age of 12, Taylor picked up a guitar and taught herself to play. She used to fret chords until her fingers bled.",
                "Although Taylor Swift's musical career blossomed smack dab in the middle of high school, she maintained a straight 4.0 G.P.A."
            ],
            "bios": [
                {
                    "title": "Nate Cavalieri",
                    "author": "Nate Cavalieri",
                    "publishDate": "",
                    "bio": "With her homespun charm, curly golden locks, and prodigious gift for songwriting, Taylor Swift is one of the youngest Nashville newcomers to capture a national audience in years. When she was just 16, Swift's first big single, \"Tim McGraw,\" peaked at No. 3 on the Billboard country chart and held a spot in the top 10 for months. On the single's success, Swift joined the ranks of teenage country queens like Tanya Tucker, Marie Osmond and LeAnn Rimes, who all charted as teenagers. Unlike those young chart-toppers, Swift wrote the song herself. Born in Wyomissing, Penn., in 1989, Swift began playing guitar at 12, and moved outside of Nashville with her family as a teen, and debuted at the Bluebird Cafe famed songwriter showcase. Her self-titled debut album, issued in October 2006, spawned a handful of radio hits such as \"Tim McGraw,\" \"Our Song\" and \"Picture to Burn,\" all of which propelled <I>Taylor Swift</I> to triple-platinum status. Not bad for a beginner! Preceded by the hit \"Love Story,\" Swift's sophomore effort, <I>Fearless</I>, was released in November 2008."
                }
            ],
