            "name": "Harry Styles",
            "shortcut": "harry-styles",
            "blurbs": [],
            "bios": [
                {
                    "title": "Bebop Digital",
                    "author": "Bebop Digital",
                    "publishDate": "",
                    "bio": "Nacido en el Reino Unido en 1994, Harry Styles inició su carrera musical aun adolescente, liderando la oscura banda White Eskimo. En 2010, después de ser eliminado del programa <I>The X Factor, </I> se juntó con cuatro participantes y volvió a competir con el  grupo bautizado de One Direction. El quinteto rápidamente se torno un fenómeno pop, lanzando entre 2011 y 2015 cinco álbumes que alcanzaron el tope de las listas y vendieron millones de copias. Al final de 2015, así, la banda anunció que dejaban los escenarios por tiempo indeterminado, y Styles firmó un contrato como artista solo con la grabadora Columbia. El primer registro de la nueva fase, bautizado con el nombre del cantante y compositor, fue lanzado en mayo de 2017, con una excelente repercusión comercial. “Sign of the Times” llegó al tope de la lista británica y americana. Músicas como “Sweet Creature”, “Carolina”, “Ever Since New York” y “Kiwi” refuerzan la apuesta en el pop rock acentuado por baladas. Styles, que cita como sus principales influencias Freddie Mercury, Elvis Presley y los Beatles, tiene en su currículo composiciones grabadas por Ariana Grande y Michael Bublé, entre otros."
                }
            ],
