            "name": "Lady Gaga",
            "shortcut": "lady-gaga",
            "amg": "1055684",
            "blurbs": [
                "Lady Gaga makes ultra-glam electro-pop that's like Bowie and Queen filtered through a dance club, power pop aesthetic.",
                "Lady Gaga is serious about her influences. In fact, her stage name itself is inspired by the Queen song \"Radio Ga-Ga.\"",
                "The former Joanne Germanotta got her start when Interscope partnered her with Akon to write songs for other artists.",
                "Gaga's known for both her flamboyant outfits (meat dress, anyone?) and her devoted fans, who she calls her Little Monsters.",
                "As a solo artist, one of her first big breaks came when she guest-starred on MTV's The Hills."
            ],
            "bios": [
                {
                    "title": "Bebop Digital",
                    "author": "Bebop Digital",
                    "publishDate": "",
                    "bio": "De personalidade polêmica, com presença de palco performática e figurino extravagante, a cantora americana Lady Gaga, nascida em 1986, se tornou uma das artistas mais bem-sucedidas na história da música pop. Também compositora, produtora, dançarina e atriz, na adolescência Stefani Joanne Angelina Germanotta, seu nome verdadeiro, já cantava em karaokês e, acompanhada pela mãe, em casas noturnas de sua cidade natal, Nova York. Aperfeiçoou seus conhecimentos musicais na Tisch School of Arts, escola que deixou ao decidir focar em sua carreira. Criou com amigos a Stefani Germanotta Band, compôs sucessos para o grupo Pussycat Dolls e foi abrindo seu próprio espaço até lançar, em 2008, o primeiro álbum <I>The Fame, </I>do hit “Poker Face”.  Conquistando a crítica e o público, o trabalho foi relançado no ano seguinte com o nome <I>The Fame Monsters </I> e trazendo oito novas faixas – entre elas “Alejandro”, “Telephone” (com participação de Beyoncé) e “Bad Romance”, um de seus maiores êxitos. O lançamento de 2011, <I>Born This Way, </I>igualmente bateu recordes de venda. Em 2014, Lady Gaga surpreendeu ao entoar canções de jazz em dueto com Tony Bennett em <I>Cheek to Cheek, </I> ganhador do Grammy de Melhor Álbum Pop Vocal Tradicional. Dois anos depois, a cantora flertou com a country music e o soul em <I>Joanne, </I>registro puxado pela faixa “Perfect Illusion”. Ainda em 2016, ela ganhou o Globo de Ouro de Melhor Atriz de Minissérie ou Filme para TV por sua participação em <I> American Horror Story.</I> Lady Gaga levou os fãs mais uma vez ao delírio em 2017 ao aparecer pendurada por cabos de aço no tradicional show no intervalo do Super Bowl, partida final do campeonato de futebol americano. No mesmo ano, a cantora retornou à sonoridade pop com o single “The Cure”, lançado no festival Coachella, na Califórnia."
                }
            ],
