            "name": "Adele",
            "shortcut": "adele",
            "amg": "861756",
            "blurbs": [
                "Pop-soul chanteuse Adele is a U.K. phenom with a smoldering set of pipes.",
                "Adele's performing arts school alums include Amy Winehouse, Leona Lewis and Kate Nash.",
                "She ignored XL Records' attempts to sign her to plan her 18th birthday party instead.",
                "She cites a diverse array of influences -- from Etta James and Bjork to Jeff Buckley and Dusty Springfield.",
                "A breakup inspired the emotional rollercoaster ride of her debut album, \"19.\""
            ],
            "bios": [
                {
                    "title": "Bebop Digital",
                    "author": "Bebop Digital",
                    "publishDate": "",
                    "bio": "British soul-pop chanteuse Adele (nee Adele Laurie Blue Adkins) is a stunning young talent with a huge voice. After she recorded a few songs, a friend set up a MySpace page for her in early 2005; record execs discovered her there in their hunt for the \"next Lily Allen.\" After signing to XL, she suffered from a terribly ill-timed case of writer's block -- that is until she fell in and out of love. A breakup opened the floodgates of emotion and creativity, resulting in her debut album <i>19</i>. Inspired by great soul dames like Etta James and Billie Holiday and other singers such as Bjork, Jeff Buckley, Dusty Springfield and Jill Scott, Adele's sense of staggering, heartbreaking honesty and artistry are evidence of her superwoman resilience and everywoman experiences."
                }
            ],
