            "blurbs": [],
            "bios": [
                {
                    "title": "Bebop Digital",
                    "author": "Bebop Digital",
                    "publishDate": "",
                    "bio": "Singer, songwriter and model, Dua Lipa is an Englishwoman of Albanian descent. After spending time in Kosovo, she returned to London with her family and, at the age of 16, she began to pursue the dream of becoming a singer. Two years earlier, she began uploading videos on YouTube performing music by her favorite artists: Nelly Furtado and Christina Aguilera. While working as a model, Dua Lipa began working on her debut album, with the support of Warner records. In August 2015, she released \"New Love\", her first single. \"Be the One\" arrived in October. 2016 was marked by the releases of \"Last Dance\", \"Hotter Than Hell\" and \"Blow Your Mind (Mwah)\". Dua Lipa describes her musical style as dark pop."
                }
            ],
