            "name": "Elton John",
            "shortcut": "elton-john",
            "amg": "4617",
            "blurbs": [
                "One of the greatest artists of the 1970s, Elton John is still a beloved pop statesman.",
                "Elton started playing piano at age four, and by age eleven he'd won a scholarship to the Royal Academy of Music.",
                "Elton John and Bernie Taupin's songwriting prowess went virtually unchallenged throughout the '70s.",
                "1972-1976 saw an unprecedented streak of sixteen consecutive Top-20 hits.",
                "Elton came from saxophonist Elton Dean and John from British phenom \"Long\" John Baldry."
            ],
            "bios": [
                {
                    "title": "Napster                                                                                                                         ",
                    "author": "Napster",
                    "publishDate": "",
                    "bio": "Elton's career achievements to date are unsurpassed in their breadth and longevity. Elton is one of the top-selling solo artists of all time, with 38 gold records and 31 platinum and multi- platinum albums, over 50 Top 40 hits, and he has sold more than 300 million records worldwide. He holds the record for the biggest-selling single of all time, “Candle in the Wind 1997,” which sold over 33 million copies. <i>Diamonds</i> the Ultimate Greatest Hits album, reached the Top 5 of the UK album charts on its release in November 2017, becoming Elton's 40th UK Top 40 album in the process. This release celebrated 50 years of his songwriting partnership with Bernie Taupin. August 2018 saw Elton named as the most successful male solo artist in Billboard Hot 100 chart history, having logged 67 entries, including nine No. 1s and 27 Top 10s.\r\n<p>\r\nElton announced the <i>Farewell Yellow Brick Road</i> tour at New York's Gotham Hall earlier this year. Encompassing 5 continents, and over 300 dates, this 3-year-long tour started in September and marks his retirement from touring after more than 50 years on the road. In May 2019 it was named Billboard's Top Rock Tour. To date, Elton has delivered more than 4,000 performances in more than 80 countries since launching his first tour in 1970. 2019 sees the release of <i>Rocketman</i>, a fantasy musical of his life and his autobiography <i>Me</i>.\r\n<p>\r\nAmong the many awards and honours bestowed upon him are five GRAMMYs including a GRAMMY Legend award, a Tony and an Oscar, a Best British Male Artist BRIT Award, induction into the Rock and Roll Hall of Fame and the Songwriters Hall of Fame, the Kennedy Center Honor, Legend of Live Award, 13 Ivor Novello Awards and a knighthood from HM Queen Elizabeth II for \"services to music and charitable services.\"\r\n<p>\r\nIn 1992, Elton established the Elton John AIDS Foundation, which today is one of the leading non-profit HIV/AIDS organizations and has raised over $400 million to date in the global fight against HIV/AIDS."
                }
            ],
