            "name": "Glass Animals",
            "shortcut": "glass-animals",
            "blurbs": [],
            "bios": [
                {
                    "title": "Bebop Digital",
                    "author": "Bebop Digital",
                    "publishDate": "",
                    "bio": "Después del ruido provocado por el EP <I>Leaflings </I>(2012),  Glass Animals,  llamó la atención del aplaudido productor británico Paul Epworth, que firmó con la banda de la ciudad de Oxford. El contrato redundó en el lanzamiento, en el año siguiente, de un EP homónimo que trajo el éxito “Black Mambo”. Mezclando indie, synth pop y toques de hip hop, el grupo divulgó su álbum de estreno, <I>Zaba, </I>en 2014, con destaque para las músicas “Hazey”, “Gooey” y “Toes”. Después de que fueron llamados para festivales como Glastonbury y Lollapalooza, los ingleses retornaron con el segundo registro en agosto de 2016. <I>How to Be a Human Being, </I>de sencillos como “Life Itself” y “Youth”, estrenó en 20º  en el ranking Billboard 200."
                }
            ],
